import React from "react";
import ReactDOM from "react-dom/client";

import "./App1/App1.css";
import "./App2/App2.css";
import "./App3/styles/App3.css";
import "./App7/styles/App7.css";

import App1 from "./App1/App1.jsx";
import App2 from "./App2/App2.jsx";
import App3 from "./App3/App3.jsx";
import App7 from "./App7/App7.jsx";

const rootElement = document.getElementById("root");
const root = ReactDOM.createRoot(rootElement);

root.render(
  <App7 />
);
